//. https://thebookofshaders.com/edit.php#10/ikeda-00.frag


IN vec2 texCoord;
UNI float time;

float random (in float x) {
    return fract(sin(x)*1e4);
}

float random (in vec2 st) {
    return fract(sin(dot(st.xy, vec2(12.9898,78.233)))* 43758.5453123);
}

float randomSerie(float x, float freq, float t) {
    return step(.8,random( floor(x*freq)-floor(t) ));
}
{{MODULES_HEAD}}
void main()
{
    vec4 col=vec4(1.0,1.0,0.05,1.0);
    vec3 randCol = vec3(0.0);
    vec2 st = texCoord;

    float f = 1.0 - pow(abs(st.x), 0.2);


    col = vec4(f,f,f, 1.0);


    float freq = random(floor(time))+abs(atan(time)*0.1);
    float t = 60.+time*(1.0-freq)*30.;

    if (fract(st.y* 0.5) < 0.5){
        t *= -1.0;
    }

    freq += random(floor(st.y));

    float offset = 0.025;
    randCol = vec3(randomSerie(st.y, freq*100., t+offset),
                 randomSerie(st.y, freq*100., t),
                 randomSerie(st.y, freq*100., t-offset));

    col = mix(vec4(randCol.rgb, 1.0), vec4(0.0), 1.0 - f);

    {{MODULE_COLOR}}
    outColor = col;
}

